create table Curso
(
    id_curso int identity
        primary key,
    nombre   varchar(100),
    horas    int,
    costo    decimal(10, 2)
);

create table Incendio
(
    id_incendio int identity
        primary key,
    tipo        varchar(30),
    magnitud    varchar(50),
    fecha_incio date,
    fecha_fin   date,
    descripcion varchar(100),
    causa       varchar(30)
);

create table Institucion_Gobernante
(
    id_intitucion_gobernante int identity
        primary key,
    nombre                   varchar(100),
    sigla                    varchar(20),
    telefono                 varchar(20),
    ubicacion_sede           varchar(150),
    email                    varchar(100),
    nombre_autoridad         varchar(100)
);

create table Gobernacion
(
    id_gobernacion           int identity
        primary key,
    id_intitucion_gobernante int
        references Institucion_Gobernante,
    departamento             varchar(50),
    num_provincias           int,
    superficies              decimal(10, 2)
);

create table Alcaldia
(
    id_alcaldia              int identity
        primary key,
    id_intitucion_gobernante int
        references Institucion_Gobernante,
    id_gobernacion           int
        references Gobernacion,
    num_consejales           int
);

create table Municipio
(
    id_municipio int identity
        primary key,
    id_alcaldia  int
        references Alcaldia,
    nombre       varchar(100),
    clima        varchar(50),
    superficie   decimal(10, 2),
    altitud      int
);

create table Area_Afectada
(
    id_area         int identity
        primary key,
    id_municipio    int
        references Municipio,
    tipo_vegetacion varchar(30),
    descripcion     varchar(100),
    coordenadas     varchar(100),
    superficie      decimal(10, 2)
);

create table Es_Afectado
(
    id_es_afectado int identity
        primary key,
    id_area        int
        references Area_Afectada,
    id_incendio    int
        references Incendio,
    costo_dano     decimal(10, 2)
);

create table Organizacion
(
    id_organizacion int identity
        primary key,
    telefono        varchar(20),
    email           varchar(100),
    ubicacion       varchar(150),
    fecha_creacion  date,
    tipo            varchar(30),
    nombre          varchar(100)
);

create table Brigada
(
    id_brigada                 int identity
        primary key,
    id_organizacion            int
        references Organizacion,
    nombre                     varchar(100),
    fecha_creacion             date,
    ubicacion_base_operaciones varchar(150)
);

create table Persona
(
    ci               varchar(15) not null
        primary key,
    expedido         varchar(50),
    paterno          varchar(50),
    materno          varchar(50),
    nombre           varchar(100),
    sexo             varchar(10),
    fecha_nacimiento date
);

create table Afectado
(
    id_afectado         int identity
        primary key,
    ci                  varchar(15)
        references Persona,
    id_area             int
        references Area_Afectada,
    telefono            varchar(20),
    email               varchar(100),
    ubicacion_domicilio varchar(150),
    condicion           varchar(20)
);

create table Bien
(
    id_bien       int identity
        primary key,
    id_afectado   int
        references Afectado,
    tipo          varchar(50),
    magnitud_dano varchar(20),
    costo_dano    decimal(10, 2)
);

create table Bombero
(
    id_bombero          int identity
        primary key,
    ci                  varchar(15)
        references Persona,
    telefono            varchar(20),
    ubicacion_domicilio varchar(150),
    email               varchar(100),
    tipo_sangre         varchar(10),
    telefono_emergencia varchar(20),
    nombre_emergencia   varchar(100)
);

create table Donante
(
    id_donante int identity
        primary key,
    ci         varchar(15)
        references Persona,
    telefono   varchar(20),
    email      varchar(100)
);

create table Enfermedad_Base
(
    id_enfermedad_Base int identity
        primary key,
    id_bombero         int
        references Bombero,
    descripcion        varchar(100)
);

create table Instructor
(
    id_instructor int identity
        primary key,
    ci            varchar(15)
        references Persona,
    telefono      varchar(20),
    email         varchar(100)
);

create table Dicta
(
    id_instructor int not null
        references Instructor,
    id_curso      int not null
        references Curso,
    fecha_inicio  date,
    fecha_fin     date,
    primary key (id_instructor, id_curso)
);

create table Oficial
(
    id_oficial int identity
        primary key,
    id_bombero int
        references Bombero,
    rango      varchar(20)
);

create table Recurso
(
    id_recurso     int identity
        primary key,
    nombre         varchar(100),
    disponibilidad varchar(20),
    descripcion    varchar(100),
    marca          varchar(50),
    estado         varchar(20)
);

create table Dinero
(
    id_dinero  int identity
        primary key,
    id_recurso int
        references Recurso,
    cantidad   int,
    moneda     varchar(50)
);

create table Dona
(
    id_donacion int identity
        primary key,
    id_recurso  int not null
        references Recurso,
    id_donante  int
        references Donante,
    fecha       date,
    metodo      varchar(20)
);

create table Herramienta
(
    id_herramienta int identity
        primary key,
    id_recurso     int
        references Recurso,
    cantidad       int,
    serie          varchar(50),
    tipo           varchar(50)
);

create table Medicamento
(
    id_medicamento     int identity
        primary key,
    id_recurso         int
        references Recurso,
    tipo_uso           varchar(20),
    fecha_vencimiento  date,
    unidad_medida      varchar(10),
    cantidad_unidad    decimal(10, 2),
    num_unidades       int,
    contraindicaciones varchar(100)
);

create table Provee
(
    id_recurso               int not null
        references Recurso,
    id_intitucion_gobernante int not null
        references Institucion_Gobernante,
    fecha                    date,
    primary key (id_intitucion_gobernante, id_recurso)
);

create table Registro_Brigada
(
    id_registro_brigada int identity
        primary key,
    id_brigada          int
        references Brigada,
    id_bombero          int
        references Bombero,
    fecha               date,
    tipo_registro       varchar(50),
    rango               varchar(30),
    disponibilidad      varchar(20)
);

create table Reporte
(
    id_reporte     int identity
        primary key,
    id_incendio    int
        references Incendio,
    id_gobernacion int
        references Gobernacion,
    caracter       varchar(20),
    mensaje        varchar(70),
    fecha          date
);

create table Alerta
(
    id_organizacion int not null
        references Organizacion,
    id_reporte      int not null
        references Reporte,
    fecha           date,
    respuesta       varchar(50),
    primary key (id_organizacion, id_reporte)
);

create table Respuesta
(
    id_respuesta         int identity
        primary key,
    id_brigada           int
        references Brigada,
    id_incendio          int
        references Incendio,
    evaluacion_respuesta varchar(100),
    fecha_incursion      date,
    fecha_retirada       date,
    resultado_operacion  varchar(100)
);

create table Participacion_Bombero
(
    id_bombero               int
        references Bombero,
    id_participacion_bombero int identity
        primary key,
    id_respuesta             int
        references Respuesta,
    inicio_incursion         date,
    fin_incursion            date
);

create table Registro_Recurso
(
    id_registro_recurso int identity
        primary key,
    id_recurso          int
        references Recurso,
    id_respuesta        int
        references Respuesta,
    tipo                varchar(20),
    fecha               date
);

create table Vehiculo
(
    placa      varchar(20) not null
        primary key,
    id_recurso int
        references Recurso,
    tipo       varchar(50),
    modelo     varchar(50),
    ano_modelo int,
    color      varchar(30)
);

create table Vivere
(
    id_vivere         int identity
        primary key,
    id_recurso        int
        references Recurso,
    unidad_medida     varchar(10),
    cantidad_unidad   decimal(10, 2),
    num_unidades      int,
    categoria         varchar(30),
    fecha_vencimiento date
);

create table Voluntario
(
    id_voluntario  int identity
        primary key,
    id_bombero     int
        references Bombero,
    disponibilidad varchar(20)
);

create table Capacita
(
    id_curso          int not null
        references Curso,
    id_voluntario     int not null
        references Voluntario,
    nota              decimal(5, 2),
    fecha_inscripcion date,
    terminado         varchar(2),
    pagado            varchar(2),
    primary key (id_curso, id_voluntario)
);

